import './App.css';
import Image from './grocery1.jpg';
import ImageTwo from './grocery2.jpg';
import { GroceryList } from './GroceryList';

function App() {
  return (
  <div className='app'>
    <div className='container'>
      <img src = { Image } width='250px' alt='Shopping'/>
    </div>

    <div>

    </div>
    <h1>Grocery List</h1>
    <GroceryList/>
    <img src = { ImageTwo } width='250px' alt='Man Shopping'/>

  </div>
  );
}

export default App;
